class Data extends Component {

  render() {
    const { person, load} = this.props;
    const { name, email, age } = person
    console.log(load);
    return (
      <div>
        {load ? 'carregando...' 
        : <div>
          <p>{name.first}</p>
          <p>{email}</p>
          <p>{age}</p>
        </div> }
      </div>
    )
  }
}

export default Data
